import react from "react";
import './SearchBox.css'

const SearchBox = () => {
    return(
       <div className="search-container">
           <input onChange={() => console.log(event.target.value)} placeholder="Type Keywords" className="search-input"></input>
       </div>
    )
}

export default SearchBox;
